import { Header } from 'src/components/Header';
import { Button } from 'src/components/Button';
import { Input } from 'src/components/Input';

import { Content, Form, Container, Title, SubTitle, ContainerButton } from './styles';

import { KeyboardAvoidingView, Platform } from 'react-native';


export function CreateProfessional2 (){

    return (

           
        <Screen>
        <KeyboardAvoidingView behavior={Platform.OS === 'ios' ? "padding" : undefined}/>
        
        <Content>
        
            <Form>
            <Container>
            <Header title='Criar conta - 2'/>
            <Title> Criar conta </Title>

            <SubTitle> Sobre seu neg√≥cio: </SubTitle>

            <Input placeholder='CNPJ*' type='primary'/>

            <Input placeholder='Nome fantasia*' type='primary'/>




            <ContainerButton> <Button title='Continuar' type='primary'/> </ContainerButton>

</Container>
            </Form>
            </Content>
        </Screen>
    )
}
